import React from 'react';
import ReactDom from 'react-dom';
import './index.css';
import App from './App';
import Master from './AdminPanel';
import CameraMaster from './Cameras';
import CSSTransitionGroup from 'react-transition-group/CSSTransitionGroup';
import {Route,Switch, BrowserRouter as Router} from 'react-router-dom';

function Main(){
  return(
    <div>
        <App />
        <Links/>
    </div>
  )
}
function Links (){
  return(
  <div>
    <li><a href="/App">Home</a></li>
      <li><a href="/AdminPanel">Cameras</a></li>
      <li><a href="#">Notifications</a></li>
      <li><a href="#">Upgrade your Aegis</a></li>
      <li><a href="#">Manage Organization</a></li>
      <CSSTransitionGroup
        transitionName="example"
        transitionAppear={true}
        transitionAppearTimeout={500}
        transitionEnter={true}
        transitionLeave={true}>
        <Router>
          <Switch>
            <Route path="/AdminPanel" component={Master} />
            <Route path="/Cameras" component={CameraMaster}/>
          </Switch>
        </Router>
      </CSSTransitionGroup>
  </div>
  )
}
export default App;
ReactDom.render(<Main/>,document.getElementById('root'))
